const Header = () => {
  return (
    <header>
      <h1>NC-Games</h1>
      <img
        src="https://www.shutterstock.com/image-vector/initial-two-letter-black-line-260nw-1466171765.jpg"
        alt="NC-Games logo"
      />
    </header>
  );
};

export default Header;
